import React from 'react';
import {Button, Card, Container, Form} from "react-bootstrap";
import NavBar from "../components/NavBar";

const Adm = () => {
    return (
        <Container className="d-flex flex-column">
            <NavBar />
            <Container className="d-flex justify-content-between mt-3 pl-3 pr-3">
                <Card style={{height: window.innerHeight / 2, backgroundColor: "#DCDCDC"}} className="mt-5">
                    <Button variant={"outline-dark"} style={{backgroundColor: "#504A4B"}} >
                        Добавить продукт
                    </Button>
                </Card>
                <Card style={{height: window.innerHeight / 2, width: window.innerWidth, backgroundColor: "#DCDCDC"}} className="mt-5">
                    
                </Card>
            </Container>
        </Container>
    );
};

export default Adm;
